import React, { Component,F } from "react";
import { ListItem, ListInfo } from "../style";

class List extends Component {
  render() {
    return (
      <Fragment>
        <ListItem>
          <img
            className="pic"
            src="https://upload-images.jianshu.io/upload_images/7691404-010aff3a3646391d.png?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240"
          ></img>
          <ListInfo>
            <h3 className="title">
              舒淇情史：与黎明相恋7年终无果，和张震约定婚期最后新娘却不是她
            </h3>
            <p className="desc">
              4月16日晚，冯德伦在社交平台发布了和妻子舒淇的合照为其庆生，并附文祝舒淇生日快乐、永远18岁、永远美丽。
              随后，舒淇也搞笑却不失甜蜜地回应道：...
            </p>
          </ListInfo>
        </ListItem>
      </Fragment>
    );
  }
}
export default List;
